import './Footer.css';

function Footer() {
    return (
        <footer className="footer">
            <ul className="footerlinks">
                <li className="footerlinks__item"><a href="privacy.html">Privacy</a></li>
                <li className="footerlinks__item"><a href="contactus.html">Contact Us</a></li>
                <li className="footerlinks__item"><a href="sitemap.html">Sitemap</a></li>
                <li className="footerlinks__item"><a href="help.html">Help</a></li>
            </ul>
        </footer>
    );
}

export default Footer;
